

class Solution:
    def checkSubarraySum(self, nums: list[int], k: int) -> bool:
        for i in range(len(nums)-1):
            numA: list[int] = nums[i:]
            # print(numA)
            for j in range(2, len(numA)+1):
                numB: list[int] = numA[:j]
                # print(numB)
                if ((sum(numB)) % k == 0):
                    return True
        return False
        


